import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./components/navbar";
import Banner from "./components/banner";
import Homepage1 from "./components/homecontainer1";
import Homepage2 from "./components/homecontainer2";
import Homepage3 from "./components/homecontainer3";
import Homepage4 from "./components/homecontainer4";
import Products from "./pages/products";
import Footer from "./components/footer";
function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Banner />
      <Homepage1 />
      <Homepage2 />
      <Homepage3 />
      <Homepage4 />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/news" element={<NewsList />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
